description: |2
      ①【TPU for Fast Printing】SUNLU High Speed TPU Filament can print 3 times fast as ordinary TPU filaments, strikes the ideal balance between softness and resilience.

      ②【TPU 3D Printing Filament】TPU filament is made of flexible thermoplastic polyurethane, featuring Shore hardness of 95A, suitable for print keyrings, insoles, mobile phone cases, etc.

      ③【Excellent Printed Results】SUNLU TPU filament 1.75mm has excellent layer adhesion, very easy to print. TPU filament is wear-resistant, oil-resistant, good elasticity, anti-aging, color, no bobble.

      ④【TPU Recommend Settings】We recommend printing at a nozzle temperature of 210-230°C, bed temperature of 50-60°C, printing speed of 80-120mm/s, faster and better.

      ⑤【TPU 1.75mm Diameter】Dimensional Accuracy +/- 0.03mm. SUNLU filament has wide compatibility due to the small diameter error, it's suitable for almost all 1.75mm FDM 3D printers.
